import sys
import requests
from bs4 import BeautifulSoup
def removeDuplicates(data):
    if None in data:
       data = set(data)
       data.remove(None)
       return list(data)
    else:
        return list(set(data))
def getDomain(string):
    revString = string[::-1]
    if revString[0] is '/':
        string = revString[::-1]
        return string
    elif revString[0].isalpha():
        if revString.find('php.') or revString.find('psa.') or revString.find('.psj'):
            string = revString[::-1]
        else:
            string = revString[::-1]
        return string
def modify_links(links,domain):
    listx = []
    domain = getDomain(string=domain)
    if domain[len(domain) - 1] is not '/':
        domain += '/'
    for web_page in links:
        if web_page.find('http') is 0:
            listx.append(web_page)
        else:
            listx.append(domain+web_page)
    return listx
def get_links(soup): # 'soup' is the object of the BeautifulSoup
    links = []
    urls = []
    for link in soup.findAll('a'):
        links.append(link.get('href'))
    links = removeDuplicates(links)
    for link in links:
        if link.find('.php') or link.find('.asp') or link.find('http'):
            urls.append(link)
    return urls
def writeData_inFile(urls):
    file = open("urls_list3.txt","a")
    for url in urls:
        file.write(url)
        file.write("\n")
    file.close()
def scrap_urls(WEB_URL_LIST):
    for page in WEB_URL_LIST:
        try:
            response = requests.get(page,timeout=3) #read the response of the website
            soup = BeautifulSoup(response.text, 'html.parser')
            links = get_links(soup)
            links = modify_links(links,page)
            print(len(links)," links scrapped from ",page)
            writeData_inFile(links)
        except (requests.exceptions.SSLError, requests.exceptions.ConnectionError):
            print("Exception! Failed to Connect...")
        except (requests.exceptions.Timeout):
            print("TimeOut")
        except (requests.exceptions.TooManyRedirects):
            print("Sorry too many Redirects. Failed to send HTTP request")
sys.setrecursionlimit(25000)
